SELECT DISTINCT("events") FROM (
SELECT last("max") AS "last" FROM /^.*$/ WHERE ("testName" =~ /^${testName:regex}$/ AND "group" =~ /^${group:regex}$/ AND "page" =~ /^${page:regex}$/ AND "summaryType" = 'pageSummary' AND "origin" = 'browsertime' AND "category" =~ /^${category:regex}$/ AND "project" =~ /^${project:regex}$/ AND "cpu" = 'event' and time >= now()-30d) GROUP BY "events" fill(none)
)

